import { Endereco } from "./Endereco";
export class Ficha {

  constructor() {
    this.etapa = 1;
  }



  etapa: number;
  token?: string;
  email?: string;
  nome?: string;
  cpf?:string;
  cep?:string;
  endereco?:Endereco;
  celular?:string;

}
